    //判断单词函数
    // 判断单词是否正确，三个参数，1，点击的字母，2.单词长度 3.正确单词拼写 
    JudgingWords(a, n, word) {
        n = parseInt(n)
        a = String(a)
        if (typeof (str) == "undefined" && typeof (arr) == "undefined") {
            str = "";
            arr = [];
            str = str + a;
            count = 0
            count++
            arr.push(a)
        } else {
            arr.push(a);
            count++
            str = str + a;
        }
        if (str.length == n) {
            if (str == word) {
                setTimeout(() => {
                    str = "";
                    count = 0
                    arr = []
                }, 500);
                return true;
            } else {
                setTimeout(() => {
                    str = "";
                    count = 0
                    arr = []
                }, 500);
                return false
            }
        }
    }

